import { React, useState} from "react";

function App() {
  const [type, setType] = useState("Menu");

  return (
    <>
      <div>
        <button classname="btn" onClick={() => setType('Services')}>Services</button>
        <button classname="btn" onClick={() => setType('Products')}>Products</button>
        <button classname="btn" onClick={() => setType('Aboutus')}>About us</button>
        <button classname="btn" onClick={() => setType('Portfolio')}>Portfolio</button>
        <button classname="btn" onClick={() => setType('FAQ')}>FAQ</button>
        <button classname="btn" onClick={() => setType('Contacts')}>Contacts</button>
      </div>
      <h1>{type}</h1>
    </>
  );
}

export default App;
